    body = charToRaw("<?xml version=\"1.0\" encoding=\"UTF-8\"?><rss xmlns:geosrc=\"http://www.geosource.org/geosrc/10\" xmlns:dcterms=\"http://purl.org/dc/terms/\" xmlns:opensearch=\"http://a9.com/-/spec/opensearch/1.1/\" xmlns:dc=\"http://purl.org/dc/elements/1.1/\" xmlns:gml=\"http://www.opengis.net/gml\" xmlns:georss=\"http://www.georss.org/georss\" xmlns:media=\"http://search.yahoo.com/mrss/\" xmlns:atom=\"http://www.w3.org/2005/Atom\" version=\"2.0\"><channel><title>Géosource_MCC 1.10</title><link>http://127.0.0.1:5512/geosource/srv/fr/rss.search</link><atom:link type=\"application/rss+xml\" rel=\"self\"/><description>Géosource est un outil de gestion et de publication des métadonnées géographiques selon la norme 19115. Il permet aussi d'échanger les fichiers dans les normes XML associées</description><copyright>\n\t\tTout droit réservé.\n\t\t\n\t</copyright><generator>GeoNetwork Open Source</generator><language>fr</language><category>Catalogue de métadonnées géographiques</category><opensearch:totalResults>11</opensearch:totalResults><opensearch:startIndex>1</opensearch:startIndex><opensearch:itemsPerPage>11</opensearch:itemsPerPage><opensearch:Query startPage=\"\" searchTerms=\"\" role=\"request\"/><item><guid isPermaLink=\"false\">4425</guid><dc:identifier>16c5cc00-4582-11ed-bda8-0050569c4ee4</dc:identifier><dc:contributor>DRAC Ile-de-France</dc:contributor><title>Domaines nationaux - Ile-de-France</title><geosrc:orderingInstruction telechargeable=\"true\">Téléchargeable gratuitement depuis l'atlas du patrimoine</geosrc:orderingInstruction><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=4425&amp;currTab=simple</link><pubDate>Mon, 29 Sep 2025 17:25:36 +0200</pubDate><category>Protection</category><category>Monument historique</category><category>Immeuble classé ou inscrit</category><category>MCC_LABEL</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><b>Résumé : </b>Les domaines nationaux sont des ensembles immobiliers présentant un lien exceptionnel avec l'histoire de la Nation et dont l'Etat est, au moins pour partie, propriétaire. Ces biens ont vocation à être conservés et restaurés par l'Etat dans le respect de leur caractère historique, artistique, paysager et écologique (loi n° 2016-925 du 7 juillet 2016 relative à la liberté de la création, à l'architecture et au patrimoine, article L621-34).\nLa liste des domaines nationaux et leur périmètre sont déterminés par décret en Conseil d'Etat sur proposition du ministre chargé de la culture, après avis de la Commission nationale du patrimoine et de l'architecture et du ministre chargé des domaines. Les propositions du ministre chargé de la culture et les avis de la Commission nationale du patrimoine et de l'architecture formulés en application de la première phrase sont rendus publics (article L621-35). Les domaines nationaux peuvent comprendre des biens immobiliers appartenant à l'Etat, à des collectivités territoriales, à des établissements publics ou à des personnes privées (article L621-35). Les parties d'un domaine national qui appartiennent à l'Etat ou à l'un de ses établissements publics sont de plein droit intégralement classées au titre des monuments historiques dès l'entrée en vigueur du décret délimitant le domaine national (article L621-37). A l'exception de celles qui sont déjà classées au titre des monuments historiques, les parties d'un domaine national qui appartiennent à une personne publique autre que l'Etat ou l'un de ses établissements publics ou à une personne privée sont de plein droit intégralement inscrites au titre des monuments historiques dès l'entrée en vigueur du décret délimitant le domaine national (article L621-38). \nL'Etat est informé avant toute cession de l'une des parties d'un domaine national appartenant à une personne autre que lui ou l'un de ses établissements publics. Il peut exercer un droit de préemption. Un décret en Conseil d'Etat définit les modalités d'application du présent article (article L621-39).</p><br clear=\"all\"/>]]></description><enclosure type=\"wms\" name=\"layers=MD_4425\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_4425/MD_4425.map&amp;layers=MD_4425&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/immeuble-classe-ou-inscrit_polygon_MD4425.sld\" length=\"0\"/><dc:relation/><dcterms:created>2022-10-06</dcterms:created><dcterms:modified>2025-09-29T17:25:13</dcterms:modified><dcterms:available>2022-10-13</dcterms:available><georss:box>48.380799025856 1.7579130731805 48.967616089797 2.721339556249</georss:box></item><item><guid isPermaLink=\"false\">3464</guid><dc:identifier>51eb4d40-6af0-11e7-bff3-0050569c4ee4</dc:identifier><dc:contributor>DRAC Ile-de-France</dc:contributor><title>Immeubles classés ou inscrits - Hauts-de-Seine - 92</title><geosrc:orderingInstruction telechargeable=\"true\"/><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=3464&amp;currTab=simple</link><pubDate>Mon, 28 Sep 2020 08:02:53 +0200</pubDate><category>Protection</category><category>Monument historique</category><category>Immeuble classé ou inscrit</category><category>MCC_LABEL</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLe