vel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><b>Résumé : </b>Immeubles protégés au titre des Monuments Historiques du département en application du Code du patrimoine, livre VI, titre II, chap. 1er, section 1 et 2, du Code de l'urbanisme.</p><br clear=\"all\"/>]]></description><enclosure type=\"wms\" name=\"layers=MD_3464\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_3464/MD_3464.map&amp;layers=MD_3464&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/tgr_immeuble-classe-ou-inscrit_polygon_MD3464.sld\" length=\"0\"/><dc:relation/><dcterms:created>2012-10-15</dcterms:created><dcterms:modified>2020-09-28T08:02:53</dcterms:modified><dcterms:available/><georss:box>48.747968228718 2.1581585641923 48.93261065941 2.3217576656563</georss:box></item><item><guid isPermaLink=\"false\">3883</guid><dc:identifier>b3fa9500-975c-11e9-809e-0050569c4ee4</dc:identifier><dc:contributor>DRAC Ile-de-France</dc:contributor><title>Label \"Architecture Contemporaine Remarquable\" - Ile-de-France</title><geosrc:orderingInstruction telechargeable=\"true\">Téléchargeable gratuitement depuis l'atlas du patrimoine</geosrc:orderingInstruction><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=3883&amp;currTab=simple</link><pubDate>Tue, 14 Jan 2025 09:34:47 +0100</pubDate><category>Protection</category><category>Label \"Architecture contemporaine remarquable\"</category><category>Architecture</category><category>Patrimoine du XXe siècle</category><category>MCC_LABEL</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><img width=\"100\" border=\"0\" alt=\"\" align=\"left\" src=\"http://127.0.0.1:5512/geosource/srv/fr/resources.get?id=3883&amp;fname=ACR_Logotype_Noir_resultat.jpg&amp;access=public\"/></p><p><b>Résumé : </b>En application de l'article L 650-1 du code du patrimoine, les immeubles, les ensembles architecturaux, les ouvrages d'art et les aménagements, parmi les réalisations de moins de cent ans d'âge, dont la conception présente un intérêt architectural ou technique suffisant reçoivent un label par décision motivée de l'autorité administrative, après avis de la commission régionale du patrimoine et de l'architecture.\n\nLe label disparaît de plein droit si l'immeuble est classé ou inscrit au titre des monuments historiques, ou cent ans après sa construction.\n\nLorsque l'immeuble, l'ensemble architectural, l'ouvrage d'art ou l'aménagement bénéficiant de ce label n'est pas protégé au titre des abords et des sites patrimoniaux remarquables ou identifié en application de l'article L. 151-19 du code de l'urbanisme, son propriétaire informe l'autorité compétente pour attribuer le label, préalablement au dépôt de la demande de permis ou de la déclaration préalable, qu'il envisage de réaliser des travaux susceptibles de le modifier.</p><br clear=\"all\"/>]]></description><media:content width=\"100\" type=\"image/gif\" url=\"http://127.0.0.1:5512/geosource/srv/fr/resources.get?id=3883&amp;fname=ACR_Logotype_Noir_resultat.jpg&amp;access=public\"/><media:text>En application de l'article L 650-1 du code du patrimoine, les immeubles, les ensembles architecturaux, les ouvrages d'art et les aménagements, parmi les réalisations de moins de cent ans d'âge, dont la conception présente un intérêt architectural ou technique suffisant reçoivent un label par décision motivée de l'autorité administrative, après avis de la commission régionale du patrimoine et de l'architecture.\n\nLe label disparaît de plein droit si l'immeuble est classé ou inscrit au titre des monuments historiques, ou cent ans après sa construction.\n\nLorsque l'immeuble, l'ensemble architectural, l'ouvrage d'art ou l'aménagement bénéficiant de ce label n'est pas protégé au titre des abords et des sites patrimoniaux remarquables ou identifié en application de l'article L. 151-19 du code de l'urbanisme, son propriétaire informe l'autorité compétente pour attribuer le label, préalablement au dépôt de la demande de permis ou de la déclaration préalable, qu'il envisage de réaliser des travaux susceptibles de le modifier.</media:text><enclosure type=\"wms\" name=\"layers=MD_3883\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_3883/MD_3883.map&amp;layers=MD_3883&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/label-architecture-contemporaine-remarquable_polygon_MD3883.sld\" length=\"0\"/><dc:relation/><dcterms:created>2018-10-25</dcterms:created><dcterms:modified>2025-01-14T09:28:17</dcterms:modified><dcterms:available>2019-06-25</dcterms:available><georss:box>48.383475613311 1.6913215551269 49.057171687234 3.0940698750494</georss:box></item><item><guid isPermaLink=\"false\">4358</guid><dc:identifier>ef5817b0-840a-11ec-afc1-0050569c4ee4</dc:identifier><dc:contributor>DRIEAT Ile-de-France</dc:contributor><title>Site inscrit - Ile-de-France (AC2)</title><geosrc:orderingInstruction telechargeable=\"true\"/><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=4358&amp;currTab=simple</link><pubDate>Tue, 27 May 2025 16:04:10 +0200</pubDate><category>Protection</category><category>Espace protégé</category><category>Zones du Code de l'environnement</category><category>Site classé ou inscrit</category><category>MCC_LABEL</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><b>Résumé : </b>Emprises des \"Zone de protection des monuments naturels et des sites de caractère artistique, historique, scientifique, légendaire ou pittoresque\" inscrites sur l'ensemble de la région Ile-de-France.</p><br clear=\"all\"/>]]></description><enclosure type=\"wms\" name=\"layers=MD_4358\" url=