otection</category><category>Espace protégé</category><category>Périmètres délimités des abords</category><category>Périmètre de protection d'un monument historique</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><b>Résumé : </b>Les parties d'un domaine national qui appartiennent à l'Etat ou à l'un de ses établissements publics sont de plein droit intégralement classées au titre des monuments historiques dès l'entrée en vigueur du décret délimitant le domaine national (article L621-37). A l'exception de celles qui sont déjà classées au titre des monuments historiques, les parties d'un domaine national qui appartiennent à une personne publique autre que l'Etat ou l'un de ses établissements publics ou à une personne privée sont de plein droit intégralement inscrites au titre des monuments historiques dès l'entrée en vigueur du décret délimitant le domaine national (article L621-38). Les domaines nationaux produisent donc des protections au titre des abords de monuments historiques (servitude d'utilité publique AC1) en application de l'article L.621-30 et de l'article L.621-31 du code du patrimoine.</p><br clear=\"all\"/>]]></description><enclosure type=\"wms\" name=\"layers=MD_4426\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_4426/MD_4426.map&amp;layers=MD_4426&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/perimetre-de-protection-d-un-monument-historique_polygon_MD4426.sld\" length=\"0\"/><dc:relation/><dcterms:created>2022-10-13</dcterms:created><dcterms:modified>2025-09-29T17:28:32</dcterms:modified><dcterms:available>2022-10-18</dcterms:available><georss:box>48.376231326303 1.7509900810917 48.972127877486 2.7281162086518</georss:box></item><item><guid isPermaLink=\"false\">4581</guid><dc:identifier>09085760-7f44-11ef-bcb3-0050569c4ee4</dc:identifier><dc:contributor>DRAC Ile-de-France</dc:contributor><title>Délimitation des zones de présomption de prescription archéologique - Ile-de-France</title><geosrc:orderingInstruction telechargeable=\"true\"/><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=4581&amp;currTab=simple</link><pubDate>Tue, 15 Jul 2025 11:06:47 +0200</pubDate><category>Protection</category><category>Zone de présomption de prescription archéologique</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>0</geosrc:scaleLevel><description><![CDATA[<p><b>Résumé : </b>Le jeu de données a pour objet d'assurer la conservation ou la sauvegarde des éléments du patrimoine archéologique susceptibles d'être affectés par des travaux publics ou privés concourant à l'aménagement du territoire. La détermination de ces zones et/ou seuils de surface vise avant tout à assurer une protection efficace des sites connus. Elle ne préjuge en aucun cas de l'édiction de prescriptions archéologiques éventuelles.\nÀ l'appui de nouvelles découvertes, les zonages archéologiques (zones de saisines et délimitation de seuil) sont susceptibles d?être individuellement, en partie ou en totalité, révisées sans obligation de périodicité. Ces zones ont été mises en place lorsque :\nune entité archéologique (EA) est attestée et recensée dans la carte archéologique nationale ;\nle potentiel de conservation du signal archéologique est fort ;\nle contexte est favorable à une implantation humaine  ;\nle territoire concerné s'inscrit dans une problématique scientifique d'étude.\nLa communication de ces informations est faite à titre purement informatif. Et elles ne sont pas tenues pour exhaustives. Ces informations reflètent l'état actuel des savoirs, en mouvement perpétuel. En effet, l'archéologie préventive (cf. Code du Patrimoine, Livre V) a permis depuis vingt ans de repenser la dynamique des occupations humaines sur le territoire.\nEn-dehors des secteurs renseignés, le potentiel archéologique est donc inconnu et non pas inexistant.</p><br clear=\"all\"/>]]></description><enclosure type=\"wms\" name=\"layers=MD_4581\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_4581/MD_4581.map&amp;layers=MD_4581&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/zone-de-presomption-de-prescription-archeologique_polygon_MD4581.sld\" length=\"0\"/><dc:relation/><dcterms:created>2022-12-16</dcterms:created><dcterms:modified>2024-10-07T15:41:53</dcterms:modified><dcterms:available/><georss:box>48.113982018584 1.5663390328946 49.163780842603 3.3163181040494</georss:box></item><item><guid isPermaLink=\"false\">3872</guid><dc:identifier>21e1e810-86b0-11e9-9d0c-0050569c4ee4</dc:identifier><dc:contributor>DRAC Ile-de-France</dc:contributor><title>Patrimoine mondial UNESCO - Emprise surfacique de la zone tampon des biens - Ile-de-France</title><geosrc:orderingInstruction telechargeable=\"true\">Téléchargeable gratuitement depuis l'atlas du patrimoine</geosrc:orderingInstruction><link>http://127.0.0.1:5512/geosource/srv/fr/metadata.show?id=3872&amp;currTab=simple</link><pubDate>Tue, 25 Feb 2025 15:48:02 +0100</pubDate><category>Protection</category><category>Patrimoine mondial</category><category>Zone tampon</category><category>MCC_LABEL</category><category>MCC_REGLEMENTAIRE</category><geosrc:scaleLevel>2</geosrc:scaleLevel><description><![CDATA[<p><img width=\"100\" border=\"0\" alt=\"\" align=\"left\" src=\"http://127.0.0.1:5512/geosource/srv/fr/resources.get?id=3872&amp;fname=document-114-1 diminue.jpg&amp;access=public\"/></p><p><b>Résumé : </b>Atlas des biens inscrits sur la liste du patrimoine mondial, en application de la convention adoptée par l'UNESCO en 1972, sur l'ensemble de l'Ile-de-France.</p><br clear=\"all\"/>]]></description><media:content width=\"100\" type=\"image/gif\" url=\"http://127.0.0.1:5512/geosource/srv/fr/resources.get?id=3872&amp;fname=document-114-1 diminue.jpg&amp;access=public\"/><media:text>Atlas des biens inscrits sur la liste du patrimoine mondial, en application de la convention adoptée par l'UNESCO en 1972, sur l'ensemble de l'Ile-de-France.</media:text><enclosure type=\"wms\" name=\"layers=MD_3872\" url=\"http://atlas.patrimoines.culture.fr/cgi-bin/mapserv?map=/home/atlas-mapserver/production/var/data/MD_3872/MD_3872.map&amp;layers=MD_3872&amp;SLD=http://atlas.patrimoines.culture.fr/SLD/zone-tampon_polygon_MD3872.sld\" length=\"0\"/><dc:relation/><dcterms:created>2019-05-07</dcterms:created><dcterms:modified>2025-02-25T15:44:45</dcterms:modified><dcterms:available>2019-05-31</dcterms:available><georss:box>48.53701168615 1.9803530274489 49.009408283683 3.324108374385</georss:box></item></channel></rss>"), 
